INSERT INTO `examen_2` VALUES (1,NULL,'CHEQUEO ESENCIAL',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL),(2,NULL,'MONITOREO',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL),(3,NULL,'FERTILIDAD Y EMBARAZO',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL),(4,NULL,'NUTRICIÓN',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL),(5,NULL,'DEPORTE',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL),(6,NULL,'SALUD SEXUAL',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL),(7,NULL,'BIENESTAR',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL),(8,NULL,'VIAJERO',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL),(9,NULL,'ADN',NULL,NULL,NULL,1,NULL,NULL,NULL,NULL),(10,1,'CHEQUEO  GENERAL ','P100','Para estos exámenes es necesario estar en ayunas','Chequeo General recomendado al menos una vez al año, se evalua el estado general de salud, nos sirve como prevención de enfermedades como Diabetes, Gota, Enfermedades cardio vasculares, Infecciones, anemia, Enfermedad hepatica, Enfermedades tiroideas y Enfermedad renal',1,'185000','180000','175000','170000'),(11,1,'CHEQUEO EXPRES','P101','Para estos exámenes es necesario estar en ayunas','Chequeo recomendados al menos una vez al año, se evalua el estado general de salud, nos sirve como oprevención de enfermedades como Diabetes, Enfermedades cardio vasculares, hepáticas, anemia y enfermedad renal',1,'75000','70000','65000','60000'),(12,1,'CHEQUEO ESCOLAR  (1 - 5 años)','P102','Para estos exámenes se recomienda un ayuno mínimo de 4 horas','Importancia clínica: Es importante hacer un chequeo de laboratorio clínico antes del inicio a clases, evitando así el ausentismo escolar por infecciones urinarias, de faringe, parásitos intestinales y anemias crónicas u otras infecciones.',1,'75000','70000','65000','60000'),(13,1,'CHEQUEO NIÑOS  (6 - 12 años)','P103','Para estos exámenes es necesario estar en ayunas','Importancia clínica: Este perfil es recomendado que se efectúe por lo menos una vez al año para descartar anemias, alteraciones de los niveles de azúcar en la sangre, predisposición a aumentos del colesterol, alergias, parásitos e infecciones de la orina.',1,'80000','75000','70000','65000'),(14,1,'CHEQUEO JOVENES- ADOLESCENTES  (13-18 años) ','P104','Para estos exámenes es necesario estar en ayunas','Importancia clínica: Este perfil es recomendado que se efectúe por lo menos una vez al año para descartar anemias, alteraciones de los niveles de azúcar en la sangre, parásitos,  predisposición a aumentos del colesterol e infecciones de la orina.',1,'55000','50000','45000','40000'),(15,1,'CHEQUEO HOMBRES MENORES DE 40 AÑOS ','P105','Para estos exámenes es necesario estar en ayunas','Importancia clínica: Evalúa el estado general de salud, además sirve para la prevención de enfermedades como: diabetes, gota, enfermedades cardiovasculares, infecciones, anemia, enfermedades del riñón. Recomendado una vez al año o cuando su médico lo indique.',1,'120000','115000','110000','105000'),(16,1,'CHEQUEO MUJERES MENORES DE  40 AÑOS ','P106','Para estos exámenes es necesario estar en ayunas','Importancia clínica: Evalúa el estado general de salud, además sirve para la prevención de enfermedades como: diabetes, gota, enfermedades cardiovasculares, infecciones, anemia, enfermedades del riñón. Recomendado una vez al año o cuando su médico lo indique.',1,'140000','135000','130000','125000'),(17,1,'CHEQUEO HOMBRES MAYORES DE 40 AÑOS','P107','Para estos exámenes es necesario estar en ayunas','Analisis de rutina recomendados al menos una vez al año, se evalua el estado general de salud, nos sirve como oprevención de enfermedades tales como Diabetes, Gota, Enferdades cardio vasculares, infecciones,  Anemia,  Enfermedad Hepática, enfermedad renal, y evaluación de la próstata',1,'180000','175000','170000','165000'),(18,1,'CHEQUEO MUJERES MAYORES DE 40 AÑOS ','P108','Para estos exámenes es necesario estar en ayunas','Analisis de rutina recomendados al menos una vez al año, se evalua el estado general de salud, nos sirve como prevención de enfermedades tales como Diabetes, Gota, Enferdades cardio vasculares, infecciones,  Anemia,  Enfermedad Hepática, Enfermedad renal, y prevención del Cancer de Cervix',1,'185000','180000','175000','170000'),(19,1,'CHEQUEO HORMONAL FEMENINO','P109','Para es exámenes deben estar en ayunas','Mide la cantidad de hormonas en el organismo, evalua la actividad de los ovarios, en caso de trastornos del ciclo menstrual o infertilidad.',1,'120000','115000','110000','105000'),(20,1,'CHEQUEO HORMONAL MASCULINO','P110','Para es exámenes deben estar en ayunas','Este perfil permite determinar la concentración hormonal androgénicas necesarias para una adecuada salud en el hombre.',1,'130000','125000','120000','115000'),(21,1,'PREQUIRURGICO  BASICO','P111','Para estos examenes no necesita estar en ayunas',' Para evaluar el estado general y de coagulación del paciente antes de la cirugía',1,'32000','27000','22000','17000'),(22,1,'CHEQUEO PREQUIRURGICO COMPLETO','P112','Para estos examenes es necesario estar en ayunas',' Para evaluar el estado general y de coagulación del paciente antes de la cirugía, minimizando los riesgos',1,'90000','85000','80000','75000'),(23,2,'CHEQUEO LIPÍDICO ','P113','Para estos examenes es necesario estar en ayunas','El perfil lipídico permite indicar el riesgo de una persona a desarrollar enfermedades cardíacas o aterosclerosis (estrechamiento u obstrucción de las arterias). Normalizar las concentraciones de lípidos lo antes posible puede reducir el riesgo de padecer enfermedades cardíacas y aterosclerosis más adelante.',1,'25000','20000','15000','10000'),(24,2,'CHEQUEO HIPERTENSION','P114','Para estos examenes es necesario estar en ayunas','Importancia clínica: La hipertensión arterial es una condición médica caracterizada por el incremento continuo de las cifras de presión arterial, es una enfermedad asintomática y fácil de detectar, cursando con complicaciones graves y letales sino se trata a tiempo. En el 90% de los casos la causa es desconocida por lo que se ha denominado hipertensión arterial esencial con una fuerte influencia hereditaria. La hipertensión es un factor de riesgo cardiovascular.',1,'110000','105000','100000','95000'),(25,2,'CHEQUEO ANEMIA','P115','Para estos examenes no necesita estar en ayunas','Estos exámenes sirven para confirmar el Diagnóstico de anemia y sus principales causas, para realizar el tratamiento adecuado y eficaz.',1,'140000','135000','130000','125000'),(26,2,'CHEQUEO CARDIACO','P116','Para estos examenes no necesita estar en ayunas','Importancia clínica: Es un conjunto de pruebas que confirman una lesión en el músculo cardíaco y la detección de un posible infarto debido a ciertas anomalías enzimáticas.  También es  recomendado para la prevención y seguimiento de procesos inflamatorios en las enfermedades cardiacas.',1,'190000','185000','180000','175000'),(27,2,'CHEQUEO DIABETES','P117','Para estos examenes es necesario estar en ayunas','El perfil de control diabético es indicado en personas con antecedentes de Diabetes en la familia, también en aquellas personas diagnosticadas que permitirá saber si el tratamiento que está recibiendo es efectivo. El control rigurosos de la Diabetes, puede prevenir o retardar el desarrollo de muchas complicaciones, de ojos, riñones, nervios etc, y tener mas años de salud sana y activa. ',1,'65000','60000','55000','50000'),(28,2,'CHEQUEO OBESIDAD','P118','Para estos examenes es necesario estar en ayunas','Importancia clínica: La obesidad es una enfermedad caracterizada por “una acumulación anormal o excesiva de grasa corporal que puede ser perjudicial para la salud”. Es crónica y su causa es multifactorial, aunque existe una base genética para la obesidad, el aumento en el consumo de calorías y estilos de vida poco saludables, sin actividad física, ha disparado la prevalencia de esta condición.',1,'220000','215000','210000','205000'),(29,2,'CHEQUEO REUMATOLÓICO','P119','Para estos examenes no necesita estar en ayunas','Importancia clínica: Las enfermedades reumáticas cursan con procesos inflamatorios y de dolor localizado o generalizado, en las diversas estructuras del aparato musculo esquelético y con mucha frecuencia con alteraciones autoinmunes y compromiso sistémico. Recomendado para personas que presenten dolores articulares y/o que padezcan de alguna enfermedad autoinmune, como artritis reumatoidea, fibromialgia, lupus eritematoso, entre otras.',1,'95000','90000','85000','80000'),(30,2,'CHEQUEO RENAL','P120','Para estos examenes no necesita estar en ayunas','Para determinar el funcionamiento de los riñones y para monotorizar el tratamiento de una enfermedad renal',1,'80000','75000','70000','65000'),(31,2,'CHEQUEO HEPÁTICO ','P121','Para estos examenes no necesita estar en ayunas','Importancia clínica: Diseñado específicamente para el diagnóstico de enfermedades hepáticas, evaluar posibles afectaciones por patologías originadas en otras partes del organismo o controlar la función hepática en pacientes que siguen tratamientos con medicamentos hepatotóxicos. ',1,'75000','70000','65000','60000'),(32,3,'CHEQUEO FERTILIDAD MUJER ','P122','Para estos examenes es necesario estar en ayunas','Importancia clínica: La evaluación típica de la fertilidad consiste en buscar las causas responsables en ambos integrantes de la pareja, para lo cual se dispone de las pruebas necesarias para evaluar las posibilidades y riesgos de la gestación. Hoy en día, sabemos la importancia de conocer  el perfil masculino, debido a que en el 50% de los casos, el hombre es la causa principal del problema.',1,'270000','265000','260000','255000'),(33,3,'CHEQUEO FERTILIDAD HOMBRE','P123','Para estos examenes es necesario estar en ayunas','Importancia clínica: La evaluación típica de la fertilidad consiste en buscar las causas responsables en ambos integrantes de la pareja, para lo cual se dispone de las pruebas necesarias para evaluar las posibilidades y riesgos de la gestación. Hoy en día, sabemos la importancia de conocer  el perfil masculino, debido a que en el 50% de los casos, el hombre es la causa principal del problema.',1,'160000','155000','150000','145000'),(34,3,'CHEQUEO PRENATAL ','P124','Para estos examenes es necesario estar en ayunas','Importancia clínica: Son estudios que se hacen durante el embarazo para controlar la salud del la madre. Permiten detectar afecciones que pueden poner al bebé en riesgo.',1,'140000','135000','130000','125000'),(35,3,'CHEQUEO PRENATAL','P125','','Importancia clínica: Las pruebas prenatales no invasivas, basadas en el análisis de ADN fetal circulante a partir de sangre materna han surgido como una herramienta potente para el diagnóstico prenatal y la detección de alteraciones en el número de cromosomas en etapas tempranas del embarazo.  A diferencia de la amniocentesis esta prueba no implica riesgo de pérdida de la gestación en la realización de la prueba.',1,'2300000','2295000','2290000','2285000'),(36,3,'CHEQUEO CONTROL DE EMBARAZO ','P126','Para estos exámenes es necesario estar en ayunas','Importancia clínica: Son estudios que se hacen durante el embarazo para controlar la salud del a madre y el bebé. Permiten detectar afecciones que pueden poner al bebé en riesgo. ',1,'180000','175000','170000','165000'),(37,4,'CHEQUEO VEGETARIANO','P127','Para estos examenes es necesario estar en ayunas','Importancia clínica Debido a la NO ingesta de productos derivados de los animales, que contienen proteínas y minerales, es recomendable realizarse exámenes periódicos para descartar anemia por falta de minerales como el hierro presente en las carnes rojas, así como evitar la desnutrición y otros problemas como la osteoporosis.',1,'160000','155000','150000','145000'),(38,4,'CHEQUEO NUTRICIONAL','P128','Para estos examenes es necesario estar en ayunas','Importancia clínica: La desnutrición continúa siendo la causa más frecuente de aumento de la morbilidad y uno de los problemas de salud en todo el mundo afectando a toda la población en general en especial pacientes hospitalizados, pacientes crónicos, niños y ancianos.',1,'480000','475000','470000','465000'),(39,4,'CHEQUEO CELIACO ','P129','','Importancia clínica:  La enfermedad celíaca es una condición del sistema inmunitario con un componente genético, en la que las personas son intolerantes al gluten. El gluten es una proteína presente en el trigo, cebada y centeno. Esta enfermedad afecta a cada persona de manera diferente, los síntomas pueden ocurrir en el sistema digestivo o en otras partes del cuerpo, ejemplo diarrea, dolor abdominal, irritación, depresión (síntoma más común en niños), de igual forma algunas personas no presenta ningún síntoma.  También aumenta el riesgo de sufrir tumores de intestino.',1,'198000','193000','188000','183000'),(40,5,'CHEQUEO INICIO DEL DEPORTE ','P130','Para estos examenes necesita estar en AYUNAS y una comida liviana el día anterior','Si bien durante nuestra vida es necesario realizar controles medicos anuales para mantenernos saludables y con una buena calidad de vida, la necesidad se hace más imperiosa antes de empezar una actividad física. ',1,'140000','135000','130000','125000'),(41,5,'CHEQUEO DEPORTISTA ','P131','Para estos examenes necesita estar en AYUNAS y una comida liviana el día anterior','Importancia clínica: La mejor prevención consiste en evitar problemas que surgen cuando se realizan ejercicios por encima de nuestras posibilidades, por eso es necesario realizar controles para conocer nuestro estado de salud, forma física y condición deportiva, antes comenzar una actividad física y durante dicha actividad deportiva.Se aconsejan 2 o 3 controles al año y sobre todo cuando aparezca síntomas que no tienen explicación lógica como fatiga, debilidad muscular, mares, disminución de peso o rendimiento.',1,'350000','345000','340000','335000'),(42,5,'CHEQUEO SUPLEMENTOS ','P132','Para estos examenes se necesita estar en AYUNAS y una comida liviana el día anterior','Importancia clínica:  Es importante  tener en cuenta que los suplementos prometen cumplir varias funciones como disminuir la grasa corporal, aumentar la masa muscular, disminuir los tiempos de recuperación o elevar el nivel de oxigenación, demostrándose en estudios que muchos de ellos sí cumplen con efectos positivos en el organismo, pero también excesos de los suplementos pueden generar complicación en la salud.',1,'390000','385000','380000','375000'),(43,6,'CHEQUEO VIDA SEXUAL RESPONSABLE','P133','Para estos examenes no necesita estar en AYUNAS ','Importancia clínica:  Se conoce como enfermedades de transmisión sexual aquellas afecciones que se transmiten por medio de contacto sexual.  Los síntomas no siempre son evidentes, pero se pueden presentar micción dolorosa, dolor en la parte baja del abdomen, flujo vaginal en mujeres, secreción uretral en hombres, dolor durante las relaciones sexuales.',1,'270000','265000','260000','255000'),(44,6,'CHEQUEO VIDA SEXUAL RESPONSABLE AMPLIADO ','P134','Para estos examenes no necesita estar en AYUNAS ','Importancia clínica:  Se conoce como enfermedades de transmisión sexual aquellas afecciones que se transmiten por medio de contacto sexual.  Los síntomas no siempre son evidentes, pero se pueden presentar micción dolorosa, dolor en la parte baja del abdomen, flujo vaginal en mujeres, secreción uretral en hombres, dolor durante las relaciones sexuales.',1,'520000','515000','510000','505000'),(45,7,'CHEQUEO FATIGA CRONICA','P135','Para estos examenes se necesita estar en AYUNAS ','Importancia clínica: El síntoma característico es el agotamiento extremo, se pueden presentar dolores de cabeza, dolor de garganta, así como dolores musculares, articulares, problemas de concentración y de memoria. La fatiga también se debe a una respuesta normal e importante al esfuerzo físico, estrés emocional, aburrimiento, falta de sueño.',1,'390000','385000','380000','375000'),(46,7,'CHEQUEO ESTADO DE ANIMO ','P136','Para estos examenes se necesita estar en AYUNAS ','Importancia clínica: Los trastornos del estado de ánimo se caracterizan por la existencia de alteraciones emocionales, consistentes en periodos prolongados de tristeza excesiva (depresión), de exaltación o euforia excesivas (manía) o de ambos. El diagnóstico del trastorno del estado de ánimo se realiza en los casos en que la tristeza o la euforia son demasiado intensas apareciendo acompañado de otros síntomas característicos y de la limitación de la capacidad de llevar una vida normal a nivel físico, social y laboral.',1,'220000','215000','210000','205000'),(47,8,'CHEQUEO VIAJERO ','P137','Para estos examenes se necesita estar en AYUNAS ','Importancia clínica: Es importante que al realizar un viaje conozca su estado de salud, existiendo algunos destinos que representan un mayor riesgo para la salud.',1,'55000','50000','45000','40000'),(48,9,'CHEQUEO ALZHEIMER','P138','','Importancia clínica:  El Alzheimer se caracteriza clínicamente por una pérdida progresiva de la memoria, alteraciones del lenguaje, de la orientación en el espacio ye l tiempo, las capacidades ejecutivas, así como alteraciones en la conducta. La enfermedad de Alzheimer se diagnóstica mayoritariamente en personas entre 75 y 80 años, no obstante, se pueden presentar casos en edades muy tempranas (por debajo de 65 años), estos casos tan precoces suelen presentar un gran componente genético.',1,'3500000','3495000','3490000','3485000'),(49,9,'CHEQUEO ENFERMEDADES HEREDITARIAS','P139','','Importancia clínica:  Este estudio de compatibilidad genética se recomienda realizarse antes de la concepción a la pareja.  También está indicado cuando hay pérdidas a repetición.  Se hace el análisis de 306 genes, con lo cual se revisa si existe el estado de portador de aproximadamente 600 enfermedades recesivas.',1,'4500000','4495000','4490000','4485000'),(50,9,'CHEQUEO CANCER','P140','','Importancia clínica:  Los cánceres son enfermedades multifactoriales debidas al efecto combinado de factores genéticos y ambientales, se estima que alrededor del 5 % de todos los tumores tienen un carácter hereditario. Los cánceres hereditarios son la consecuencia de mutaciones germinales en gene concretos que incrementan la susceptibilidad para padecerlos, se hereda la susceptibilidad a padecer cáncer, lo que no implica la certeza de desarrollarlo en todos los casos. La identificación de familias con posibles cánceres hereditarios es importante ya que sus miembros podrán beneficiarse de medidas eficaces no sólo en la detección precoz, sino también en la prevención de los tumores.',1,'3500000','3495000','3490000','3485000');
