INSERT INTO `guion` VALUES (1,'<p>En Vitălea somos una guía para que junto con tu médico realicen el correcto seguimiento de tu salud.<br><br>Para esto contamos con Vitălea Esencial.<br>Son una serie de chequeos  para aquellos que no tienen síntomas de ninguna enfermedad, se consideran sanos, no se han realizado un chequeo actualmente y desean conocer en un estado general que ocurre con su cuerpo.<br><br>Contamos con más de 40 chequeos especializados.<br><br>¿Estás interesado/a en algún chequeo en especial?<br><br>Si deseas más información puedes ingresar a:<br>www.vitalea.com.co<br>Vitălea salud proactiva a tu alcance.</p>',1,1),(2,'<p>Cuando ya contamos con un manejo especializado en alguna enfermedad es indispensable controlarnos y no esperar a tener más complicaciones, ¿sabías que medirse periódicamente es la única manera de estar 100% seguros sobre lo que ocurre con nuestro cuerpo?, en VIVE+LAB    contamos con: <br>\r\n<b>V-CARE</b><br>\r\n \r\nExámenes especializados para quienes desean evaluarse de hipertensión, obesidad, cardiopatía, enfermedad reumática o diabetes. <br>\r\n\r\nConoce más información sobre cada uno de ellos en: (web) <br>\r\nVIVE+LAB  salud preventiva a tu alcance, para un futuro brillante.\r\n</p>\r\n',4,1),(3,'<p>En Vitălea somos una guía para que junto con tu médico realicen el correcto seguimiento de tu salud.<br><br>Para esto contamos con Vitălea Deporte.<br>Son chequeos ideales para quienes empezaron hace poco el gym y desean conocer cómo la actividad física influye en su cuerpo, o para aquellos deportistas frecuentes que desean controlar como va su condición deportiva.<br><br>Contamos con más de 40 chequeos especializados. <br><br>¿Estás interesado/a en algún chequeo en especial?<br><br>Si deseas más información puedes ingresar a:<br>www.vitalea.com.co<br>Vitălea salud proactiva a tu alcance.</p>',2,1),(4,'<p>En Vitălea somos una guía para que junto con tu médico realicen el correcto seguimiento de tu salud.<br><br>Para esto contamos con Vitălea Nutrición.<br>Son un grupo de chequeos enfocados en conocer cómo se encuentra tu cuerpo a nivel de energía, saber si el aporte de vitaminas y minerales es el adecuado y mantener así un metabolismo activo.<br>Si eres vegano o tienes alergia al gluten tenemos el chequeo ideal para ti.<br><br>Contamos con más de 40 chequeos especializados. <br><br>¿Estás interesado/a en algún chequeo en especial?<br><br>Si deseas más información puedes ingresar a:<br>www.vitalea.com.co<br>Vitălea salud proactiva a tu alcance.</p>',3,1),(5,'<p>El medio ambiente, algunos alimentos y hasta ciertos animales pueden causarnos reacciones alérgicas y el desconocimiento nos puede producir problemas futuros, ¿sabías que medirse periódicamente es la única manera de estar 100% seguros sobre lo que ocurre con nuestro cuerpo?, en VIVE+LAB    contamos con:<br>\r\n<b>V-WELL</b><br> \r\nExámenes especializados para quienes desean evaluar alergias por ciertos alimentos, animales, organismos ambientales, productos industriales, medicamentos, o quienes sufren de fatiga crónica o cambios en su estado emocional.<br>\r\nConoce más información sobre cada uno de ellos en: (web)<br>\r\nVIVE+LAB  salud preventiva a tu alcance, para un futuro brillante.</p>\r\n',7,1),(6,'<p>En Vitălea somos una guía para que junto con tu médico realicen el correcto seguimiento de tu salud.<br><br>Para esto contamos con Vitălea ADN.<br>Si en tu familia hay una enfermedad genética, se han presentado síntomas de pérdida de memoria o  antecedentes de cáncer. Estos chequeos especializados puedes encontrar exámenes que te permitan conocer tu estado de salud y ver la posibilidad de riesgos de enfermedad hereditaria, para tomar medidas a tiempo.<br><br>Contamos con más de 40 chequeos especializados. <br><br>¿Estás interesado/a en algún chequeo en especial?<br><br>Si deseas más información puedes ingresar a:<br>www.vitalea.com.co<br>Vitălea salud proactiva a tu alcance.</p>',6,1),(7,'<p>En Vitălea somos una guía para que junto con tu médico realicen el correcto seguimiento de tu salud.<br><br>Para esto contamos con Vitălea Fertilidad y Embarazo.<br>Son chequeos pensados para aquellas personas que están buscando tener un bebé, ya están en el proceso, o desean realizar un control de este nuevo miembro de la familia.<br><br>Contamos con más de 40 chequeos especializados. <br><br>¿Estás interesado/a en algún chequeo en especial?<br><br>Si deseas más información puedes ingresar a:<br>www.vitalea.com.co<br>Vitălea salud proactiva a tu alcance.</p>',8,1),(8,'<p>En Vitălea somos una guía para que junto con tu médico realicen el correcto seguimiento de tu salud.<br><br>Para esto contamos con Vitălea Viajero.<br>Este chequeo está dirigido a quienes les gusta conocer nuevos lugares, o visitan destinos que representan un mayor riesgo para su salud. Les ayuda a conocer su estado actual y les permite estar preparados ante cualquier eventualidad.<br><br>Contamos con más de 40 chequeos especializados. <br><br>¿Estás interesado/a en algún chequeo en especial?<br><br>Si deseas más información puedes ingresar a:<br>www.vitalea.com.co<br>Vitălea salud proactiva a tu alcance.</p>',9,1),(9,'<p>En Vitălea somos una guía para que junto con tu médico realicen el correcto seguimiento de tu salud.<br><br>Para esto contamos con Vitălea Vida Sexual.<br>Son chequeos que te permiten saber si hay enfermedades de transmisión sexual y poder controlar aquellas afecciones.Recuerda que llevar una vida sexual responsable es cuestión de autocuidado.<br><br>Contamos con más de 40 chequeos especializados. <br><br>¿Estás interesado/a en algún chequeo en especial?<br><br>Si deseas más información puedes ingresar a:<br>www.vitalea.com.co<br>Vitălea salud proactiva a tu alcance.</p>',5,1);
